import React from 'react';
import { Card, Form, Input, Typography, Button} from "antd";
import styles from './styles';
import Title from 'antd/es/skeleton/Title';

function StoryForm() {
  return (
<Card 
style={styles.formCard} 
title={<Title></Title>}>
</Card>
  )
}

export default StoryForm;
